const Adventure = () => {

    const [searchTerm, setSearchTerm] = useState('');
  
    const handleSearch = (term) => {
      setSearchTerm(term);
    };
  
    // Filter the anime list based on the search term
    const adventureanimelist = adventureAnimeList.filter((anime) =>
      anime.name.toLowerCase().includes(searchTerm.toLowerCase())
    );

  return (
    <div className="genre-page">
      <Navbar onSearch={handleSearch}/>
      <div className="genre-header">
        <h1>Adventure Anime</h1>
        <p>Embark on thrilling journeys with our collection of adventure anime.</p>
      </div>
      <div className="anime-list">
        {adventureanimelist.length > 0 ? (
          adventureanimelist.map((anime) => (
            <AnimeCard
              key={anime.id}
              image={anime.image}
              name={anime.name}
              languages={anime.languages}
              episodes={anime.episodes}
              duration={anime.duration}
              videoUrl={anime.videoUrl}
            />
          ))
        ) : (
          <p>No adventure anime found</p>
        )}
      </div>
      <Footer />
    </div>
  );
};

export default Adventure;
